The History Channel Lock N' Load with R. Lee Ermey:  &quot;Rockets&quot; 


Season 1, Episode 8, HDTV-720p


Original Air Date:  25 September 2009 




Gunny gets a first-hand look at the &quot;rocket's red glare&quot; as he demonstrates rockets dating back to ancient Chinese to today's state of the art self guiding missiles. Weapons include: the ancient Korean Hwacha--a rocket powered weapon designed to launch a volley of deadly arrows; The Congreve--the rocket that inspired the Star Spangled Banner; the TOW--one of the first &quot;guided&quot; rockets, 
and today's state-of-the-art Javelin.
